import React from 'react'
import Table from './Table'

const GnG = () => {
    const racks =
    {
        server: ["test1", "test2","test3","test4","test5"],
        network_1: ["test1", "test2",""],
        network_2: ["test1", "test2"],
        storage: ["test1", "test2"],
        peripheral: ["test1", "test2"]
    }


    function normalizeArrayLengths(data, fillValue = "") {
        const maxLength = Math.max(...Object.values(data).map((arr) => arr.length));
        return Object.fromEntries(
          Object.entries(data).map(([key, value]) => [key, value.concat(Array(maxLength - value.length).fill(fillValue))])
        );
    }
    
    
    

    return (
        <div className='flex mx-2 border-r border-black mt-10'>

            <Table rack={racks.server} name="Server" />
            <Table rack={racks.network_1} name="Network-I"/>
            <Table rack={racks.network_2}name="Network-II"/>
            <Table rack={racks.storage}name="Storage"/>
            <Table rack={racks.peripheral}name="Peripheral"/>

        </div>

    )
}

export default GnG
